    false,nt"url": null,nt"notes": "This tabular data set represents the mean
    percent tree canopy from the Canopy Layer of the National Land Cover Dataset 2001
    (LaMotte and Wieczorek, 2010), compiled for every MRB_E2RF1 catchment of Major River
    Basins (MRBs, Crawford and others, 2006). The source data set represents tree canopy
    percentage for the conterminous United States for 2001. The Canopy Layer of the
    National Land Cover Data Set for 2001 was produced through a cooperative project
    conducted by the Multi-Resolution Land Characteristics (MRLC) Consortium. The MRLC
    Consortium is a partnership of Federal agencies (http://www.mrlc.gov), consisting
    of the U.S. Geological Survey (USGS), the National Oceanic and Atmospheric Administration
    (NOAA), the U.S. Environmental Protection Agency (USEPA), the U.S. Department of
    Agriculture (USDA), the U.S. Forest Service (USFS), the National Park Service (NPS),
    the U.S. Fish and Wildlife Service (USFWS), the Bureau of Land Management (BLM),
    and the USDA Natural Resources Conservation Service (NRCS). The MRB_E2RF1 catchments
    are based on a modified version of the U.S. Environmental Protection Agency's (USEPA)
    ERF1_2 and include enhancements to support national and regional-scale surface-water
    quality modeling (Nolan and others, 2002; Brakebill and others, 2011). Data were
    compiled for every MRB_E2RF1 catchment for the conterminous United States covering
    New England and Mid-Atlantic (MRB1), South Atlantic-Gulf and Tennessee (MRB2), the
    Great Lakes, Ohio, Upper Mississippi, and Souris-Red-Rainy (MRB3), the Missouri
    (MRB4), the Lower Mississippi, Arkansas-White-Red, and Texas-Gulf (MRB5), the Rio
    Grande, Colorado, and the Great basin (MRB6), the Pacific Northwest (MRB7) river
    basins, and California (MRB8).",nt"license_title": null,nt"extras": [{ntt"key":
